column8:
50000mAh バッテリーケース for iPhone,サムスン  バックアップ バッテリー 



英語名：50000mAh 2 USB External Battery Backup Charger Power Bank For iPhone Samsung
<br><br>
1）100％新品<br>
2）容量：50000mAh（大容量）<br>
3）入力：5V 1A<br>
4）3出力ポート<br>
1：5V 1A（スマホ用）、2：5V 2.1A（パッド用など）<br>
デュアルUSBポートは、同時に2つのデバイスを充電することができます<br>
5）寸法：160 x 70 mm<br>
6）重量：430g<br>
7）サークルタイム：1000回<br>
8）バッテリ ステータス：4LED表示灯<br><br>


互換性<br>
(iphone、サムスン、HTC、ノキア等) などのスマホ、デジタル カメラ、PDA、PSP、MP3、Mp4、アプリなど。<br>
付属の USBケーブルでバッテリーを接続できます。<br><br>

パッケージ:<br>
バッテリー x 1<br>
1 x USB ケーブル<br><br><br>


パワーバンクを充電する手順<br>
1. マイクロ USB コネクタに接続し、パワーバンクに入れてください<br>
2. もう一方の端をアダプタのUSBポートに接続し、USB出力をコンセントに接続します。<br><br>
電子デバイスを充電する手順<br>
1. 一端をパワーバンクの出力に接続します。<br>
2. もう一方の端をお使いのデバイスのコネクタに接続してください</DIV>
